INSERT INTO `b_thing` VALUES (99, '精制口腔检查', '7adf16b2-a966-4b4a-962e-23c79568854a.jpeg', '口腔检查是一种常见的医疗检查，用于评估口腔健康和诊断口腔疾病。口腔检查通常由口腔医生、牙医或口腔卫生师进行。以下是口腔检查的一般步骤和内容：\r\n\r\n1. 病史询问：医务人员会询问您有关口腔健康、症状、疾病史和用药史等方面的信息，这有助于医生做出更准确的诊断。\r\n\r\n2. 外部检查：医生会检查您口腔外部的皮肤、唇、颈部和颌部等区域，观察是否有异常情况，如溃疡、肿块或炎症等。\r\n\r\n3. 内部检查：医生会使用口腔检查器具（口镜、探针等）仔细检查口腔内部的每个部位，包括牙齿、牙龈、舌头、颊部等，检查是否有龋齿、牙龈疾病、口腔溃疡、牙周炎等问题。\r\n\r\n4. X光检查：在需要进一步观察牙齿和口腔结构的情况下，医生可能会建议进行X光检查，以帮助诊断隐匿的问题。\r\n\r\n5. 诊断和治疗建议：根据口腔检查的结果，医生会给出诊断并制定相应的治疗方案。治疗可能包括口腔卫生教育、洁牙、补牙、拔牙、植牙等。\r\n\r\n口腔检查是预防口腔疾病和保持口腔健康的重要手段。定期进行口腔检查可以帮助早期发现并及时治疗口腔健康问题，维护口腔健康和整体健康。如果您有口腔不适或疑似口腔问题，建议及时到口腔医生进行检查。', '32', '0', 0, '三个月', '老年人', '提前刷牙', '1716540269213', 3, 2, 0, 0, 0, 2, 2, NULL);
